// src/App.js
import React from 'react';
import './App.css';
import Card from './components/Card';

const App = () => {
    const renderGrid = () => {
        let grid = [];
        for (let i = 0; i < 16; i++) {
            grid.push(<Card key={i} />);
        }
        return grid;
    };

    return (
        <div className="App">
            <div className="grid-container">
                {renderGrid()}
            </div>
        </div>
    );
};

export default App;
